<script>
    document.addEventListener("DOMContentLoaded", function () {
        document.querySelector('.btn-download').addEventListener('click', function () {
            console.log("Download button clicked!");

            const tableElement = document.getElementById('ticketTable');
            if (!tableElement) {
                console.error("Error: Table element not found!");
                return;
            }

            // Clone table for PDF generation
            const tempContainer = document.createElement('div');
            tempContainer.innerHTML = `
               <div class="mb-3" style="font-family: Arial, sans-serif; display: flex;">
               <div>
    <img style="width: 200px; height: 170px" src="data:image/png;base64," alt="Company Logo" style="max-width: 100px; display: block; margin: 0 auto;">

    </div>
    
    <div>
    <br>
    <p style="margin: 5px 0; font-size: 18px;">Phone: +250 785 263 931</p>
    <p style="margin: 5px 0; font-size: 18px;">P.O BOX: 780 Kigali  Rwanda</p>
    <p style="margin: 5px 0; font-size: 18px;">Email: e_ticket@gmail.com</p>
    </div>
    </div>
    <hr style="border: 1px solid #000; margin: 5px 0;">
    <div>
    
    
    <h5 style="margin: 15px 42rem; font-size: 18px; font-weight: bold;">Ticket Report</h5>
    
    <p style="margin: 5px 10px; font-size: 14px;">Generated on: ${new Date().toLocaleDateString()}</p>
    </div>


            `;

            // Clone table while ensuring it's fully visible in the PDF
            let clonedTable = tableElement.cloneNode(true);
    clonedTable.style.width = "100%";  // Ensure full width
    clonedTable.style.pageBreakInside = "auto";  // Allow page breaks
    clonedTable.querySelectorAll("th, td").forEach(function(cell) {
    cell.style.fontSize = "16px"; // Adjust to a larger size
}); // Reduce font size to fit more content
    tempContainer.appendChild(clonedTable);

    html2pdf()
    .from(tempContainer)
    .set({
        margin: [10, 10, 10, 10],  // Proper margins
        filename: 'Tickets_Report.pdf',
        image: { type: 'jpeg', quality: 0.98 },
        html2canvas: { scale: 1.5, scrollY: 0 },  // Lower scale to fit more data
        jsPDF: { unit: 'mm', format: 'a3', orientation: 'landscape' },  // Use A3 for more space
        pagebreak: { mode: ['avoid-all', 'css', 'legacy'] }  // Ensure page breaks correctly
    })
    .save();
       
        });
    });
</script>


